                          </option>
                        })
                      }
                    </select>
                  </div>

                  <div class="col-md-6 form-group">
                    <label for="room">Số Lượng</label>
                    <select name="" id="room" class="form-control">
                      <option value="1">1</option>
                      <option value="2">2</option>
                      <option value="3">3</option>
                    </select>
                  </div>
                </div>
                <div class="row">
                  <div class="col-md-12 form-group">
                    <label for="email">Email</label>
                    <input type="email" id="email" class="form-control " />
                  </div>
                </div>
                <div class="row">
                  <div class="col-md-12 form-group">
                    <label for="message">Write a Note</label>
                    <textarea name="message" id="message" class="form-control " cols="30"
                      rows="8"></textarea>
                  </div>
                </div>
                <div class="row">
                  <div class="col-md-6 form-group">
                    <input type="submit" value="Đặt Phòng Ngay" class="btn btn-primary" />
                  </div>
                </div>
              </form> */}
              <Form form={form} name="control-hooks" onFinish={onFinish} onSubmit={submitForm}>

                <Form.Item label="DatePicker">
                  <RangePicker />
                </Form.Item>

            <Form.Item
              name="roomtype"
              label="Roomtype"
              rules={[
                { required: true, message: 'Hãy chọn 1 tỉnh' }
              ]}
            >
              <Select onChange={setRoomTypes}>
                {
                  roomTypes.map((roomType,index) => {
                    return <Select.Option
                      key={index}
                      value={roomType.LoaiPhong}>
                        {roomType.LoaiPhong}
                      </Select.Option>
                  })
                }
              </Select>
            </Form.Item>

            <Form.Item
              name="district"
              label="District"
              rules={[
                { required: true, message: 'Hãy chọn 1 huyện' }
              ]}
            >
              <Select disabled={!province} onChange={setCurrentDistrict}>
                {
                  districts.map(district => {
                    return <Select.Option
                      key={district.id}
                      value={district.id}>
                        {district.name}
                      </Select.Option>
                  })
                }
              </Select>
            </Form.Item>

            <Form.Item
              name="ward"
              label="Ward"
              rules={[
                { required: true, message: 'Hãy chọn 1 xã' }
              ]}
            >
              <Select disabled={!district}>
                {
                  wards.map(ward => {
                    return <Select.Option
                      key={ward.id}
                      value={ward.id}>
                        {ward.name}
                      </Select.Option>
                  })
                }
              </Select>
            </Form.Item>

            <Form.Item
              name="avatar"
              label="Avatar"
              rules={[
                { required: true, message: 'Hãy chọn avatar' }
              ]}
            >
              <Upload
                name="avatar"
                listType="picture-card"
                className="avatar-uploader"
                showUploadList={false}
                // action="https://www.mocky.io/v2/5cc8019d300000980a055e76"
