              >
                {imageUrl ? <img src={imageUrl} alt="avatar" style={{ width: '100%' }} /> : uploadButton}
              </Upload>
            </Form.Item>

            <Button type="primary" onClick={submitForm}>Submit</Button>
          </Form>
              
            </div>
          </div>
        </div>
      </section>
    </>
  );
};

export default Booking;
